

    function adStatusHandler(status) {
    var started=false;
    var watched=false;
    switch(status){
        case "ad-started":
            
            if(!started){
                GatoRewardStart()
                started=true;
            }
        break;

        case "fb-started":   
            if(!started){
                GatoRewardStart()
                started=true;
            }   
        break;

        case "ads-unavailable":

        break;

        case "ad-interrupted":
            console.error("Applixir ads interupted disqualify rewards")
        break;

        case "ad-watched":
            this.watched=true;
            console.log("Normal ad watched")
        break;

        case "fb-watched":
            this.watched=true;
            console.log("Fallback ad watched")
        break;


        case "sys-closing":
            if(this.watched!==false){
                GatoReward()
            }
            GatoAds.RewardStarted=false;
            break;
        }
    }
